from z3 import *
s = Solver()

#Declaring parameter variables

N = Real('N')
s.add(N >= 0)
T = Real('T')
s.add(T >= 0)
F = Real('F')
s.add(F >= 0)
NplusTdiv2 = Real('NplusTdiv2')
s.add(NplusTdiv2 >= 0)

#Adding the resilience condition

s.add(Or((2 * NplusTdiv2) == (N + T),(2 * NplusTdiv2) == ((N + T) - 1)))
s.add(N > 3)
s.add(F >= 0)
s.add(T >= 1)
s.add(N > (3 * T))
s.add(F <= T)
s.add((NplusTdiv2 + 1) > ((2 * T) + 1))

